import React, { useState } from 'react';
import Timer from './Timer';
import BTSYoutube from './Youtube/BTSYoutube.js';
import KirbyYoutube from './Youtube/KirbyYoutube';
import './App.css';

function App() {

  return (
    <div>
    <div className="App">

      <Timer/>

      <button
      className="BTSBtn"
      onClick={<BTSYoutube/>}>
      BTS
      </button>

      <button
      className="KirbyBtn"
      onClick={<KirbyYoutube/>}>
      Kirby
      </button>

      <BTSYoutube/>

    </div>
    </div>
  )
}

export default App;
